const fs = require("fs");
const image =
  "data:image/jpeg;base64,";

fs.writeFile(
  `public/img/category/اسماك وجمبري.jpeg`,
  image.split("base64,")[1],
  { encoding: "base64" },
  function (err) {
    if (err) {
      console.log(err);
    } else {
      console.log(`اسماك وجمبري.jpeg is created`);
    }
  }
);
